// Dependencies
import React, { Component } from 'react';
import photo from './Home.jpg'

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <h1 style={{textAlign: 'center'}}>Home Page</h1>
        <img src={photo} alt="Fede Luna" height="300px" style={{padding: '20%'}}></img>
      </div>
    );
  }
}

export default Home;
